request.description:
### Generate SKU

This endpoint allows you to generate SKUs for inventory items.

#### Request

- Method: POST

- URL: `{{erp-env}}/inventory/sku/generate`

- Headers:

    - Content-Type: application/json

- Body:

    - department_id (string, required): The ID of the department for the inventory item.

    - brand_id (string, required): The ID of the brand for the inventory item.


#### Response

The response for this request is a JSON object following the schema below:

``` json
{
  "type": "object",
  "properties": {
    "sku": {
      "type": "string"
    }
  }
}

 ```

The response contains the generated SKU for the inventory item.

This endpoint is used to generate SKUs for inventory items.

#### Request Body

- `department_id` (string): The ID of the department for which SKUs are to be generated.

- `brand_id` (string): The ID of the brand for which SKUs are to be generated.


#### Response

The response for this request is a JSON object conforming to the following schema:

``` json
{
  "type": "object",
  "properties": {
    "sku": {
      "type": "string",
      "description": "The generated SKU for the inventory item."
    }
  }
}

 ```

